import styled from "styled-components";
import { motion } from "framer-motion";

const NavbarFewerColosStyle = styled(motion.div)`
  position: absolute;
  right: 1vw;
  width: 800px;
  background-color: #f8f8ff;
  height: auto;
  padding: 20px;
  cursor: auto;
  display: flex;
  justify-content: space-between;
  .section {
    display: flex;
    flex-direction: column;
    height: 350px;
    width: 150px;
    * {
      cursor: auto;
    }
    .cover {
      position: absolute;
      background-color: darkviolet;
      height: 100px;
      width: 150px;
    }
    .title {
      color: #679267;
      margin-top: 120px;
      margin-bottom: 10px;
    }
    span {
      color: #1f1f1f;
    }
  }
`;
const NavbarFewerColos = () => {
  return <NavbarFewerColosStyle></NavbarFewerColosStyle>;
};
export default NavbarFewerColos;
